import React from 'react';

export const Terminal = ({ listOfThreads }) => {
    return (
        <>
            {listOfThreads.map(thread => {
                return(
                    <ul key={thread.id}>
                        <li>{thread.command}</li>
                        <li><span>&nbsp;{thread.output}</span></li>
                    </ul>
                )
            })}
        </>
    )
}
